3a\u0441\u00bb. \u0417\u0432\u0443\u0447\u043d\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0434\u0430\u043d\u043e \u0432 \u043f\u0430\u043c\u044f\u0442\u044c \u043e\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BC%D0%B5,_%D0%90%D0%BD%D1%82%D1%83%D0%B0%D0%BD\" class=\"mw-redirect\" title=\"\u041b\u043e\u043c\u0435, \u0410\u043d\u0442\u0443\u0430\u043d\">\u0410\u043d\u0442\u0443\u0430\u043d\u0435 \u0434\u0430 \u041b\u0430 \u041c\u043e\u0442\u0442 \u041a\u0430\u0434\u0438\u043b\u043b\u0430\u043a\u0435<\/a>, \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%82%D1%80%D0%BE%D0%B9%D1%82\" title=\"\u0414\u0435\u0442\u0440\u043e\u0439\u0442\">\u0414\u0435\u0442\u0440\u043e\u0439\u0442\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911\" class=\"mw-redirect\" title=\"1911\">1911<\/a>&#160;\u2014 \u0418\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%B2%D1%80\" title=\"\u041b\u0443\u0432\u0440\">\u041b\u0443\u0432\u0440\u0430<\/a> \u043f\u043e\u0445\u0438\u0449\u0435\u043d \u043f\u043e\u0440\u0442\u0440\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B0_%D0%9B%D0%B8%D0%B7%D0%B0\" title=\"\u041c\u043e\u043d\u0430 \u041b\u0438\u0437\u0430\">\u041c\u043e\u043d\u044b \u041b\u0438\u0437\u044b<\/a>. \u0427\u0435\u0440\u0435\u0437 \u0434\u0432\u0430 \u0433\u043e\u0434\u0430 \u043a\u0430\u0440\u0442\u0438\u043d\u0430 \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u043e \u0431\u044b\u043b\u0430 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0430 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%80%D0%B5%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u043b\u043e\u0440\u0435\u043d\u0446\u0438\u044f\">\u0424\u043b\u043e\u0440\u0435\u043d\u0446\u0438\u0438<\/a>. \u0417\u0430\u0434\u0435\u0440\u0436\u0430\u043d\u043d\u044b\u0439 \u043f\u043e\u0437\u0434