3e\u0431 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B2%D0%BE%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D1%83%D1%87%D0%B8%D0%BB%D0%B8%D1%89%D0%B5\" title=\"\u0421\u0443\u0432\u043e\u0440\u043e\u0432\u0441\u043a\u043e\u0435 \u0432\u043e\u0435\u043d\u043d\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435\">\u0441\u0443\u0432\u043e\u0440\u043e\u0432\u0441\u043a\u0438\u0445<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%85%D0%B8%D0%BC%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D1%83%D1%87%D0%B8%D0%BB%D0%B8%D1%89%D0%B5\" title=\"\u041d\u0430\u0445\u0438\u043c\u043e\u0432\u0441\u043a\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435\">\u043d\u0430\u0445\u0438\u043c\u043e\u0432\u0441\u043a\u0438\u0445<\/a> \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0443\u0447\u0438\u043b\u0438\u0449, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u0435\u0434\u0443\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u043b\u043e\u0441\u044c \u00ab\u0434\u043b\u044f \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430, \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f \u0438 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f \u0434\u0435\u0442\u0435\u0439 \u0432\u043e\u0438\u043d\u043e\u0432 \u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u0410\u0440\u043c\u0438\u0438, \u043f\u0430\u0440\u0442\u0438\u0437\u0430\u043d \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0434\u0435\u0442\u0435\u0439 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0438 \u043f\u0430\u0440\u0442\u0438\u0439\u043d\u044b\u0445 \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u043a\u043e\u0432, \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0438 \u043a\u043e\u043b\u0445\u043e\u0437\u043d\u0438\u043a\u043e\u0432, \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445 \u043e\u0442 \u0440\u0443\u043a \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0445 \u043e\u043a\u043a\u0443\u043f\u0430\u043d\u0442\u043e\u0432, \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u0442\u044c\u2026 \u0434\u0435\u0432\u044f\u0442\u044c \u0441\u0443\u0432\u043e\u0440\u043e\u0432\u0441\u043a\u0438\u0445 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0443\u0447\u0438\u043b\u0438\u0449, \u0442\u0438\u043f\u0430 \u0441\u0442\u0430\u0440\u044b\u0445 \u043a\u0430\u0434\u0435\u0442\u0441\u043a\u0438\u0445 \u043a\u043e\u0440\u043f\u0443\u0441\u043e\u0432, \u043f\u043e 500 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0432 \u043a\u0430\u0436\u0434\u043e\u043c, \u0432\u0441\u0435\u0433\u043e 4500 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0441\u043e \u0441\u0440\u043e\u043a\u043e\u043c \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f 7 \u043b\u0435\u0442, \u0441 \u0437\u0430\u043a\u0440\u044b\u0442\u044b\u043c \u043f\u0430\u043d\u0441\u0438\u043e\u043d\u043e\u043c \u0434\u043b\u044f \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u043d\u0438\u043a\u043e\u0432\u2026\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944\" class=\"mw-redirect\" title=\"1944\">1944<\/a>&#160;\u2014 \u0412 \u0414\u0443\u043c\u0431\u0430\u0440\u0442\u043e\u043d-\u041e\u043a\u0441\u0435 \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u0421\u0428\u0410, \u0421\u0421\u0421\u0420 \u0438 \u0410\u043d\u0433\u043b\u0438\u0438 \u043f\u043e \u0432\u043e\u043f\u0440\u043e\u0441\u0443 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.or